var playlisturl = '';
var playlistName = '';
var playlistOwner = '';
var playlistZip = new JSZip();
var songsLoadNum = 0;
var songsLoaded = 0;
var songsEnabled = 0;
var songsDownloaded = 0;
var songsToDownload = 0;
var songsRequested = 0;

window.onload = function() {
	getPlaylistHTML();
};

function enterURL(ele) {
    if(event.key === 'Enter') {
        submitURL(ele.value);        
    }
}

function submitURL(playlisturl) {
	if (playlisturl.toLowerCase().includes('spotify.com')) {
		window.location.href = 'spotify.html?playlisturl=' + encodeURIComponent(playlisturl);
	} else if (playlisturl.toLowerCase().includes('youtube.com')) {
		window.location.href = 'youtube.html?playlisturl=' + encodeURIComponent(playlisturl);
	}
}

function getURL() {
	var origurl = decodeURIComponent(new URL(window.location.href).searchParams.get('playlisturl'));
	var playlisturl = '';
	if (origurl.includes('list=')) {
		playlisturl = 'https://www.youtube.com/playlist?list=' + (new URL(origurl).searchParams.get('list'));
	} else {
		playlisturl = origurl;
	}
	return playlisturl;
}

function getPlaylistHTML() {
	var htmlFile = new XMLHttpRequest();
	var myURL = getURL()
	if (myURL.includes('list=')) {
		if (new URL(myURL).searchParams.get('list').toString().startsWith('PL')) {
			htmlFile.open('GET', 'https://cors-anywhere.herokuapp.com/' + myURL, true);
			htmlFile.setRequestHeader('Origin', 'https://bscustomplaylistcompiler.github.io/')
			htmlFile.onreadystatechange = function() {
				if (htmlFile.readyState === 4) {  // Makes sure the document is ready to parse.
					if (htmlFile.status === 200) {  // Makes sure it's found the file.
						var allText = htmlFile.responseText;
						var myText = '';
						if (allText.split('["ytInitialData"] = ').length > 1) {
							myText = allText.split('["ytInitialData"] = ')[1].split('\n')[0];
							myText = myText.slice(0, myText.length - 1);
						} else if (allText.split('<div id="initial-data"><!-- ').length > 1) {
							myText = allText.split('<div id="initial-data"><!-- ')[1].split('\n')[0];
							myText = myText.split(' -->')[0];
						}
						var resourceJSON = JSON.parse(myText);
						var videoID = null;
						var playlistID = null;
						if (resourceJSON['contents'].hasOwnProperty('twoColumnBrowseResultsRenderer')) {
							videoID = resourceJSON['contents']['twoColumnBrowseResultsRenderer']['tabs'][0]['tabRenderer']['content']['sectionListRenderer']['contents'][0]['itemSectionRenderer']['contents'][0]['playlistVideoListRenderer']['contents'][0]['playlistVideoRenderer']['videoId'];
							playlistID = resourceJSON['responseContext']['serviceTrackingParams'][1]['params'][0]['value'];
							songsLoadNum = parseInt(resourceJSON['sidebar']['playlistSidebarRenderer']['items'][0]['playlistSidebarPrimaryInfoRenderer']['stats'][0]['simpleText'].split(' ')[0]) - 1;
							playlistName = resourceJSON['microformat']['microformatDataRenderer']['title'];
							playlistOwner = resourceJSON['sidebar']['playlistSidebarRenderer']['items'][1]['playlistSidebarSecondaryInfoRenderer']['videoOwner']['videoOwnerRenderer']['title']['runs'][0]['text'];
							document.getElementById('songsInfo').innerText = 'Songs Loaded - ' + songsLoaded + '/' + songsLoadNum;
							document.getElementById('playlistInfo').innerText = 'Playlist - "' + playlistName + '" Owner - "' + playlistOwner + '"';
						} else if (resourceJSON['contents'].hasOwnProperty('singleColumnBrowseResultsRenderer')) {
							videoID = resourceJSON['contents']['singleColumnBrowseResultsRenderer']['tabs'][0]['tabRenderer']['content']['sectionListRenderer']['contents'][0]['itemSectionRenderer']['contents'][0]['playlistVideoListRenderer']['contents'][0]['playlistVideoRenderer']['videoId'];
							playlistID = resourceJSON['responseContext']['serviceTrackingParams'][0]['params'][0]['value'];
							songsLoadNum = parseInt(resourceJSON['header']['playlistHeaderRenderer']['stats'][0]['runs'][0]['text'].split(' ')[0]) - 1;
							playlistName = resourceJSON['header']['playlistHeaderRenderer']['title']['runs'][0]['text'];
							playlistOwner = resourceJSON['header']['playlistHeaderRenderer']['ownerText']['runs'][0]['text'];
							document.getElementById('songsInfo').innerText = 'Songs Loaded - ' + songsLoaded + '/' + songsLoadNum;
							document.getElementById('playlistInfo').innerText = 'Playlist - "' + playlistName + '" Owner - "' + playlistOwner + '"';
						}
						playlistID = playlistID.slice(2, playlistID.length);
						getVideoHTML('https://www.youtube.com/watch?v=' + videoID + '&list=' + playlistID);
					} else {
						getPlaylistHTML();
					}
				}
			}
			htmlFile.send(null);
		} else {
			document.getElementById('alertSpace').innerHTML = '<div class="w3-panel w3-red w3-card-4 w3-display-container" style="width:90%; margin-left:5%;"><span onclick="this.parentElement.style.display=\'none\'"class="w3-button w3-display-topright">&times;</span><h3>Warning!</h3><p>List submitted is not a playlist.</p></div>';
		}
	} else {
		document.getElementById('alertSpace').innerHTML = '<div class="w3-panel w3-red w3-card-4 w3-display-container" style="width:90%; margin-left:5%;"><span onclick="this.parentElement.style.display=\'none\'"class="w3-button w3-display-topright">&times;</span><h3>Warning!</h3><p>No list detected.</p></div>';
	}
}

function getVideoHTML(videoURL) {
	var htmlFile = new XMLHttpRequest();
	htmlFile.open('GET', 'https://cors-anywhere.herokuapp.com/' + videoURL, true);
	htmlFile.setRequestHeader('Origin', 'https://bscustomplaylistcompiler.github.io/')
	htmlFile.onreadystatechange = function() {
		if (htmlFile.readyState === 4) {  // Makes sure the document is ready to parse.
			if (htmlFile.status === 200) {  // Makes sure it's found the file.
				var allText = htmlFile.responseText;
				getSongs(allText);
			} else {
				getVideoHTML(videoURL);
			}
		}
	}
	htmlFile.send(null);
}

function getSongs(sourceHTML) {
	var myText = '';
	if (sourceHTML.split('["ytInitialData"] = ').length > 1) {
		myText = sourceHTML.split('["ytInitialData"] = ')[1].split('\n')[0];
		myText = myText.slice(0, myText.length - 1);
	} else if (sourceHTML.split('<div id="initial-data"><!-- ').length > 1) {
		myText = sourceHTML.split('<div id="initial-data"><!-- ')[1].split('\n')[0];
		myText = myText.split(' -->')[0];
	}
	var resourceJSON = JSON.parse(myText);
	var playlistID = '';
	var playlistLength = 0;
	var highestVisibleID = 0;
	var highestVisibleVideoID = '';
	var songItems = null;
	if (resourceJSON['contents'].hasOwnProperty('twoColumnWatchNextResults')) {
		playlistID = resourceJSON['contents']['twoColumnWatchNextResults']['playlist']['playlist']['playlistId'];
		playlistLength = parseInt(resourceJSON['contents']['twoColumnWatchNextResults']['playlist']['playlist']['totalVideos']);
		highestVisibleID = parseInt(resourceJSON['contents']['twoColumnWatchNextResults']['playlist']['playlist']['contents'][resourceJSON['contents']['twoColumnWatchNextResults']['playlist']['playlist']['contents'].length - 1]['playlistPanelVideoRenderer']['indexText']['simpleText']);
		highestVisibleVideoID = resourceJSON['contents']['twoColumnWatchNextResults']['playlist']['playlist']['contents'][resourceJSON['contents']['twoColumnWatchNextResults']['playlist']['playlist']['contents'].length - 1]['playlistPanelVideoRenderer']['videoId'];
		songItems = resourceJSON['contents']['twoColumnWatchNextResults']['playlist']['playlist']['contents'];
	} else if (resourceJSON['contents'].hasOwnProperty('singleColumnWatchNextResults')) {
		playlistID = resourceJSON['contents']['singleColumnWatchNextResults']['playlist']['playlist']['playlistId'];
		playlistLength = parseInt(resourceJSON['contents']['singleColumnWatchNextResults']['playlist']['playlist']['totalVideosText']['runs'][0]['text'].split(' ')[0]);
		highestVisibleID = parseInt(resourceJSON['contents']['singleColumnWatchNextResults']['playlist']['playlist']['contents'][resourceJSON['contents']['singleColumnWatchNextResults']['playlist']['playlist']['contents'].length - 1]['playlistPanelVideoRenderer']['indexText']['runs'][0]['text']);
		highestVisibleVideoID = resourceJSON['contents']['singleColumnWatchNextResults']['playlist']['playlist']['contents'][resourceJSON['contents']['singleColumnWatchNextResults']['playlist']['playlist']['contents'].length - 1]['playlistPanelVideoRenderer']['videoId'];
		songItems = resourceJSON['contents']['singleColumnWatchNextResults']['playlist']['playlist']['contents'];
	}
	var songNames = new Array();
	var songArtists = new Array();
	for (songItem in songItems) {
		try {
			var myIndex = 0;
			if (resourceJSON['contents'].hasOwnProperty('twoColumnWatchNextResults')) {
				myIndex = parseInt(songItems[songItem]['playlistPanelVideoRenderer']['indexText']['simpleText']);
			} else if (resourceJSON['contents'].hasOwnProperty('singleColumnWatchNextResults')) {
				myIndex = parseInt(songItems[songItem]['playlistPanelVideoRenderer']['indexText']['runs'][0]['text']);
			}
			if (myIndex > songsRequested || myIndex == '▶') {
				var simpleText = '';
				if (resourceJSON['contents'].hasOwnProperty('twoColumnWatchNextResults')) {
					simpleText = songItems[songItem]['playlistPanelVideoRenderer']['title']['simpleText'];
				} else if (resourceJSON['contents'].hasOwnProperty('singleColumnWatchNextResults')) {
					simpleText = songItems[songItem]['playlistPanelVideoRenderer']['title']['runs'][0]['text'];
				}
				if (simpleText.startsWith('[')) {
				simpleText = simpleText.split(']').slice(1).join(']').trim();
				}
				if (simpleText.startsWith('(')) {
				simpleText = simpleText.split(')').slice(1).join(')').trim();
				}
				if (simpleText.startsWith('{')) {
				simpleText = simpleText.split('}').slice(1).join('}').trim();
				}
				var myArtistName = simpleText.trim();
				var mySongName = simpleText.trim();
				if (mySongName.split('- ').length > 1) {
					mySongName = mySongName.split('- ').slice(1).join('- ').trim();
					myArtistName = simpleText.split('- ')[0].trim();
				} else if (mySongName.split(':').length > 1) { 
					mySongName = mySongName.split(':').slice(1).join(':').trim();
					myArtistName = simpleText.split(':')[0].trim();
				} else if (mySongName.split('|').length > 1) { 
					mySongName = mySongName.split('|').slice(1).join('|').trim();
					myArtistName = simpleText.split('|')[0].trim();
				}
				songNames.push(mySongName);
				songArtists.push(myArtistName);
			}
		} catch (err) {
			songsLoadNum -= 1;
		}
	}
	for (song in songNames) {
		if (songNames[song].includes('feat.')) {
			songNames[song] = songNames[song].slice(0, songNames[song].indexOf('feat.'));
		}
		if (songNames[song].includes('ft.')) {
			songNames[song] = songNames[song].slice(0, songNames[song].indexOf('ft.'));
		}
		if (songNames[song].includes(' feat ')) {
			songNames[song] = songNames[song].slice(0, songNames[song].indexOf(' feat '));
		}
		if (songNames[song].includes(' ft ')) {
			songNames[song] = songNames[song].slice(0, songNames[song].indexOf(' ft '));
		}
		if (songNames[song].includes('(')) {
			songNames[song] = songNames[song].slice(0, songNames[song].indexOf('('));
		}
		if (songNames[song].includes('/')) {
			songNames[song] = songNames[song].slice(0, songNames[song].indexOf('/'));
		}
		if (songNames[song].includes('[')) {
			songNames[song] = songNames[song].slice(0, songNames[song].indexOf('['));
		}
		if (songNames[song].includes('{')) {
			songNames[song] = songNames[song].slice(0, songNames[song].indexOf('{'));
		}
		songNames[song] = songNames[song].trim();
	}
	for (song in songNames) {
		var filtSong = songNames[song].toString().toLowerCase().replace(/[^a-z0-9 ]/g, '').trim();
		if (filtSong.includes('official video')) {
			filtSong = filtSong.split('official video')[0];
		}
		if (filtSong.includes('official music video')) {
			filtSong = filtSong.split('official music video')[0];
		}
		if (filtSong.includes('official lyric video')) {
			filtSong = filtSong.split('official lyric video')[0];
		}
		getBeatsaverHTML(filtSong, songNames[song], songArtists[song], true);
	}
	songsRequested = highestVisibleID;
	if (playlistLength > highestVisibleID) {
		getVideoHTML('https://www.youtube.com/watch?v=' + highestVisibleVideoID + '&list=' + playlistID + '&index=' + highestVisibleID);
	}
}

function getBeatsaverHTML(filtSong, songName, songArtist, firstRun) {
	var htmlFile = new XMLHttpRequest();
	var searchName = '';
	if (firstRun) {
		var filtArtist = songArtist;
		if (filtArtist.includes('feat.')) {
			filtArtist = filtArtist.slice(0, filtArtist.indexOf('feat.'));
		}
		if (filtArtist.includes('ft.')) {
			filtArtist = filtArtist.slice(0, filtArtist.indexOf('ft.'));
		}
		if (filtArtist.includes(' feat ')) {
			filtArtist = filtArtist.slice(0, filtArtist.indexOf(' feat '));
		}
		if (filtArtist.includes(' ft ')) {
			filtArtist = filtArtist.slice(0, filtArtist.indexOf(' ft '));
		}
		if (filtArtist.includes('(')) {
			filtArtist = filtArtist.slice(0, filtArtist.indexOf('('));
		}
		if (filtArtist.includes('/')) {
			filtArtist = filtArtist.slice(0, filtArtist.indexOf('/'));
		}
		if (filtArtist.includes('[')) {
			filtArtist = filtArtist.slice(0, filtArtist.indexOf('['));
		}
		if (filtArtist.includes('{')) {
			filtArtist = filtArtist.slice(0, filtArtist.indexOf('{'));
		}
		filtArtist = filtArtist.trim();
		searchName = (filtSong + ' ' + filtArtist).toLowerCase();
	} else {
		searchName = filtSong;
	}
	htmlFile.open('GET', 'https://cors-anywhere.herokuapp.com/https://www.beatsaver.com/search/all?key=' + encodeURIComponent(searchName), true);
	htmlFile.setRequestHeader('Origin', 'https://bscustomplaylistcompiler.github.io/')
	htmlFile.onreadystatechange = function() {
		if (htmlFile.readyState === 4) {  // Makes sure the document is ready to parse.
			if (htmlFile.status === 200) {  // Makes sure it's found the file.
				var allText = htmlFile.responseText;
				displaySong(allText, songName, songArtist, filtSong, firstRun);
			} else {
				getBeatsaverHTML(filtSong, songName, songArtist, firstRun);
			}
		}
	}
	htmlFile.send(null);
}

function displaySong(beatsaverHTML, songName, songArtist, filtSong, firstRun) {
	var table = document.getElementById('songTable');
	var row = table.insertRow(songsLoaded + 1);
	var songCell = row.insertCell(0);
	var artistCell = row.insertCell(1);
	var beatsaverCell = row.insertCell(2);
	var downloadCell = row.insertCell(3);
	songCell.innerHTML = songName;
	artistCell.innerHTML = songArtist;
	if (beatsaverHTML.includes('<a href="https://www.beatsaver.com/browse/detail/') || beatsaverHTML.includes('<a href="https://beatsaver.com/browse/detail/') || beatsaverHTML.includes('<a href="https://www.beatsaver.com/index.php/browse/detail/') || beatsaverHTML.includes('<a href="https://beatsaver.com/index.phpbrowse/detail/')) {
		var beatsaverCellHTML = '<select onchange="updateDownloads()" style="width: 100%;"><option value="[No Song]">[No Song]</option>';
		var defaultSet = false;
		var regex = /<a href="https:\/\/(www\.)?beatsaver\.com\/(index\.php\/)?browse\/detail\//gi, result, strIndices = [];
		while ( (result = regex.exec(beatsaverHTML)) ) {
			strIndices.push(parseInt(result.index) + 45);
		}
		var bsSongID = '';
		var bsSongName = '';
		for (arrIndex in strIndices) {
			var thisIndex = strIndices[arrIndex];
			var secondIndex = beatsaverHTML.slice(parseInt(thisIndex), beatsaverHTML.length).indexOf('">');
			bsSongID = beatsaverHTML.slice(parseInt(thisIndex), parseInt(thisIndex) + parseInt(secondIndex));
			if (bsSongID.includes('ail/')) {
				bsSongID = bsSongID.slice(4, bsSongID.length);
			}
			if (bsSongID.includes('etail/')) {
				bsSongID = bsSongID.slice(6, bsSongID.length);
			}
			var thirdIndex = beatsaverHTML.slice(parseInt(thisIndex) + parseInt(secondIndex) + 6, beatsaverHTML.length).indexOf('</a>');
			bsSongName = beatsaverHTML.slice(parseInt(thisIndex) + parseInt(secondIndex) + 2, parseInt(thisIndex) + parseInt(secondIndex) + 6 + parseInt(thirdIndex));
			if (defaultSet) {
				beatsaverCellHTML += '<option value="';
			} else {
				beatsaverCellHTML += '<option selected="selected" value="';
				defaultSet = true;
			}
			beatsaverCellHTML += bsSongID + '">' + bsSongName + '</option>';
		}
		beatsaverCellHTML += '</select>';
		beatsaverCell.innerHTML = beatsaverCellHTML;
	} else {
		if (firstRun) {
			table.deleteRow(row.rowIndex);
			getBeatsaverHTML(filtSong, songName, songArtist, false);
			return false;
		} else {
			beatsaverCell.innerHTML = '<select style="width: 100%;"><option selected="selected" value="[No Song]">[No Song]</option></select>';
		}
	}
	updateDownloads();
	songsLoaded += 1;
	document.getElementById('songsInfo').innerText = 'Songs Loaded - ' + songsLoaded + '/' + songsLoadNum;
	if (songsLoaded >= songsLoadNum) {
		document.getElementById('btnDownloadAll').disabled = false;
		document.getElementById('btnDownloadBeatDrop').disabled = false;
	}
}
	
function updateDownloads() {
	var table = document.getElementById('songTable');
	var loadedSongCount = 0;
	for (arrRow in table.rows) {
		if (arrRow != 0) {
			var myRow = table.rows[arrRow];
			try {
				var mySelect = myRow.cells[2].getElementsByTagName('select')[0];
				var mySong = myRow.cells[0].innerText;
			} catch (err) {}
			var bsSongID = mySelect.options[mySelect.selectedIndex].value;
			if (bsSongID == '[No Song]') {
				try {
					myRow.cells[3].innerHTML = 'N/A';
				} catch (err) {}
			} else {
				try {
					loadedSongCount += 1;
					myRow.cells[3].innerHTML = '<a href="https://beatsaver.com/download/' + bsSongID + '/">' + bsSongID + '</a>';
				} catch (err) {}
			}
		}
	}
	songsEnabled = loadedSongCount;
}

function downloadAll() {
	document.getElementById('btnDownloadAll').disabled = true;
	document.getElementById('btnDownloadBeatDrop').disabled = true;
	for (rowID in document.getElementById('songTable').rows) {
		if (rowID != 0) {
			try {
				document.getElementById('songTable').rows[rowID].cells[2].getElementsByTagName('select')[0].disabled = true;
			} catch (err) {}
		}
	}
	alert('Download Started - Compiling may take a few minutes...');
	songsToDownload = 0;
	songsDownloaded = 0;
	var table = document.getElementById('songTable');
	for (arrRow in table.rows) {
		if (arrRow != 0) {
			var bsSongID = '';
			try {
				bsSongID = table.rows[arrRow].cells[3].innerText;
			} catch (err) {}
			if (bsSongID != 'N/A' && bsSongID != '') {
				songsToDownload += 1;
			}
		}
	}
	document.getElementById('downloadInfo').innerText = 'Songs Downloaded - ' + songsDownloaded + '/' + songsToDownload;
	for (arrRow in table.rows) {
		if (arrRow != 0) {
			var myRow = table.rows[arrRow];
			var mySelect = null;
			try {
				mySelect = myRow.cells[2].getElementsByTagName('select')[0];
			} catch (err) {}
			var bsSongID = mySelect.options[mySelect.selectedIndex].value;
			if (bsSongID != '[No Song]') {
				downloadSong(bsSongID);
			}
		}
	}
}

function downloadSong(bsSongID) {
	var xhr = new XMLHttpRequest();
	xhr.open('GET','https://beatsaver.com/download/' + bsSongID + '/',true);
	xhr.overrideMimeType('application/octet-stream');
	xhr.responseType = 'arraybuffer';
	xhr.onload = function (v) {
		var arrBuff = xhr.response;
		playlistZip.file(bsSongID + '.zip', arrBuff);
		songsDownloaded += 1;
		document.getElementById('downloadInfo').innerText = 'Songs Downloaded - ' + songsDownloaded + '/' + songsToDownload;
		if (songsDownloaded >= songsEnabled) {
			playlistZip.generateAsync({type:'blob'}).then(function (blob) {
				saveAs(blob, playlistName.replace(/[^a-zA-Z0-9]/g, '').trim() + '.zip');
				document.getElementById('btnDownloadAll').disabled = false;
				document.getElementById('btnDownloadBeatDrop').disabled = false;
				for (rowID in document.getElementById('songTable').rows) {
					if (rowID != 0) {
						try {
							document.getElementById('songTable').rows[rowID].cells[2].getElementsByTagName('select')[0].disabled = false;
						} catch (err) {}
					}
				}
				document.getElementById('downloadInfo').innerText = 'Songs Downloaded - Not Downloading';
			}, function (err) {
				console.log(err);
			});
		}
	};
	xhr.onerror = function (e) {
		downloadSong(bsSongID);
	};
	xhr.send();
}

function downloadBeatDrop() {
	document.getElementById('btnDownloadAll').disabled = true;
	document.getElementById('btnDownloadBeatDrop').disabled = true;
	for (rowID in document.getElementById('songTable').rows) {
		if (rowID != 0) {
			try {
				document.getElementById('songTable').rows[rowID].cells[2].getElementsByTagName('select')[0].disabled = true;
			} catch (err) {}
		}
	}
	document.getElementById('downloadInfo').innerText = 'Songs Downloaded - 0/1';
	var beatDropJSON = JSON.parse("{}");
	beatDropJSON['playlistTitle'] = playlistName;
	beatDropJSON['playlistAuthor'] = playlistOwner;
    beatDropJSON['image'] = 'data:image/jpeg;base64,';
	var mySongs = new Array();
	var table = document.getElementById('songTable');
	for (arrRow in table.rows) {
		if (arrRow != 0) {
			try {
				if (table.rows[arrRow].cells[3].innerHTML.toString() != 'N/A') {
					var mySongJSON = JSON.parse("{}");
					mySongJSON['key'] = table.rows[arrRow].cells[3].innerText;
					var mySelect =  table.rows[arrRow].cells[2].getElementsByTagName('select')[0];
					mySongJSON['songName'] = mySelect.options[mySelect.selectedIndex].innerText.toString();
					mySongs.push(mySongJSON);
				}
			} catch (err) {}
		}
	}
	beatDropJSON['songs'] = mySongs;
	var myFile = document.createElement('a');
	myFile.setAttribute('href', 'data:text/plain;charset=utf-8,' + encodeURIComponent(JSON.stringify(beatDropJSON)));
	myFile.setAttribute('download', (playlistName.replace(/[^a-zA-Z0-9]/g, '') + '.json'));
	myFile.style.display = 'none';
	document.body.appendChild(myFile);
	myFile.click();
	document.body.removeChild(myFile);
	document.getElementById('downloadInfo').innerText = 'Songs Downloaded - 1/1';
	document.getElementById('btnDownloadAll').disabled = false;
	document.getElementById('btnDownloadBeatDrop').disabled = false;
	for (rowID in document.getElementById('songTable').rows) {
		if (rowID != 0) {
			try {
				document.getElementById('songTable').rows[rowID].cells[2].getElementsByTagName('select')[0].disabled = false;
			} catch (err) {}
		}
	}
	document.getElementById('downloadInfo').innerText = 'Songs Downloaded - Not Downloading';
}
